import React from 'react';
import { v4 } from 'uuid';
import FormControl from '@material-ui/core/FormControl';
import InputLabel from '@material-ui/core/InputLabel';
import { Select } from '@material-ui/core';
import MenuItem from '@material-ui/core/MenuItem';
import TextField from '@material-ui/core/TextField';
import { DepositsList, DepositItem } from '../interfaces/interfaces';

interface CalculatorPrefProps {
  properties: DepositsList;
}

export const CalculatorPref: React.FC<CalculatorPrefProps> = ({
  properties,
}: CalculatorPrefProps): React.ReactElement => {
  return (
    <>
      <FormControl variant="outlined">
        <InputLabel id="demo-simple-select-outlined-label">Тип</InputLabel>
        <Select
          labelId="demo-simple-select-outlined-label"
          id="demo-simple-select-outlined"
          // value={age}
          // onChange={handleChange}
          label="Тип"
        >
          <MenuItem value="">
            <em>Тип депозита</em>
          </MenuItem>
          {properties.deposits.map((el: DepositItem) => (
            <MenuItem key={v4()} value={el.code}>
              {el.name}
            </MenuItem>
          ))}
        </Select>
      </FormControl>
      <TextField id="outlined-basic" label="Сумма" variant="outlined" />
      <TextField id="outlined-basic" label="Срок" variant="outlined" />
    </>
  );
};
